import React from 'react'
import './Header.css'

const Header = () => {
  return (
    <div className="gpt3__header section__padding" id="home">
      <div className="gpt3__header-content">
      <h1 className="gradient__text">Unleash your inner artist </h1>
      <p>Abstract expressionism, surreal landscapes, vibrant colors blending harmoniously. Sculptures capturing emotions, frozen in time. Brushstrokes dancing on canvas, telling stories untold. Artistic vision transcending boundaries, provoking thoughts, evoking emotions. Creativity flowing freely, a tapestry of artistic exploration</p>
      </div>

      </div>
  )
}

export default Header
